import React from 'react'
import styles from './Btn.module.scss'

export default ({ title, styleBtn, className, onClick }) => {
  return (
    <div className={ styles[ styleBtn ] + (className ? ' ' + className : '') } onClick={ onClick && null }>
      { title }
    </div>
  )
}
